import React from "react";

function ToDoItem(props) {
  return (
    <div
      onClick={() => {
        props.onChecked(props.id);
      }}
    >
      <button>
      <li contentEditable="true">{props.text}</li>
       </button>
    </div>
  );
}

export default ToDoItem;
